import React from "react";

function Header() {
    return (
        <header className="header">
            <h1>To-Do List</h1>
            <div>
                <ul id="todoItems"></ul>
                <form id="todoForm">
                    <input type="text" id="todoInput" placeholder="Add a new item..."></input>
                    <button type="submit">Add</button>
                </form>
            </div>
        </header>
    );
}

export default Header;
